import React from "react";
import Athlete from "./Athlete";
import useFetch from "./useFetch";

const Home = () => {
    const { data: athletes, isPending, error } = useFetch('http://localhost:3030/athletes')

    return (
        <section>
            {error && <p>{error}</p>}
            {isPending && <p>Loading Athletes...</p>}
            {athletes && <Athlete athletes={athletes} />}
        </section>
    )
}

export default Home;
